Sony MHCV7D

Gracias a los efectos de DJ podrás dar tu toque personal a las pistas

Anima a los invitados con los efectos de DJ. Los cuatro efectos diferentes crean el escenario perfecto para tu fiesta: Flanger crea un efecto de retumbante profundidad; WAH distorsiona el sonido; Isolator aísla una banda de frecuencia específica; y PAN barre el sonido en ambos altavoces. Los efectos de DJ, accesibles desde la aplicación Fiestable, y el control de gestos, te permitirán ser de lo más creativo con las listas de reproducción para tus fiestas.

Sistema de altavoces de 3 vías para un sonido potente

Obtén todo el rango de frecuencias con el impactante sonido del sistema de altavoces de 3 vías. Con dos tweeters de 4 cm (1.6"), dos medios de 12 cm (4.7") y un woofer de 25 cm (9.8"), podrás escuchar agudos vibrantes, medios sólidos y potentes graves en toda tu música.

Activa los ajustes de fiesta con el control de gestos

Dale tu propio toque a la fiesta con un sencillo movimiento. El control de gestos divertido e intuitivo te permite tomar el mando de todas las funciones de fiesta, incluyendo la iluminación, efectos de DJ y efectos de sonido del micrófono. También puedes deslizar hacia la izquierda o derecha para pasar de canción y controlar el volumen. Personalizar tu fiesta nunca había sido tan divertido.

Funciones de karaoke para que también cantes

Organizar concursos de karaoke con tus amigos es de lo más sencillo: conecta el MHC-V7D a un televisor e introduce un DVD de karaoke, o canta canciones de YouTube accediendo mediante Bluetooth. Las dos entradas de micrófono, la reserva de canciones, las puntuaciones y los efectos de sonido te permiten formar equipo con tus amigos para que cantéis como un auténtico grupo. El Karaoke-PON integrado incluso baja la voz del CD para que puedas cantar tus canciones favoritas.

MEGA BASS potencia tu línea de graves

Pulsa el botón MEGA BASS para aumentar seriamente la potencia de las frecuencias bajas en tu música. Para lograrlo, refuerza las líneas de bajo a fin de crear un sonido más potente. Pulsa el botón para activar el modo y déjate llevar por el contundente sonido de los graves.

